import React, { useEffect, useState } from "react";
import Styles from "./Selector.module.scss";

const Selector = ({
  fields,
  onClickFunction,
  heading,
  setOpenedSelector,
  name,
  openedSelector,
}) => {
  return (
    <select>
      <option value="1"></option>
      <option value="2"></option>
      <option value="3"></option>
      <option value="4"></option>
    </select>
  );
};
export default Selector;
